19353715&amp;type=3" target=""><abbr title="04.03.2018, 16:23" data-utime="1520176988" data-shorten="1" class="_5ptz"><span class="timestampContent">4 marca</span></abbr></a></span></span><span class="_6spk" role="presentation" aria-hidden="true"> · </span><div class="_6a _29ee _4f-9 _43_1" data-hover="tooltip" data-tooltip-content="Cz&#x142;onkowie grupy Odrzyw&#xf3;&#x142; i okolice" role="img" aria-label="Cz&#x142;onkowie grupy Odrzyw&#xf3;&#x142; i okolice"><span><i class="_1lbg img sp_PcNl_Pzo88k sx_b60292"></i></span></div></div></div></div></div></div></div></div></div><div data-ad-preview="message" class="_5pbx userContent _3576" data-ft="&#123;&quot;tn&quot;:&quot;K&quot;&#125;"><p>Jestem dziewczyną z Odrzywółu </p><p> Jestem dziewczyną, biegającą za marzeniami, po leśnych polanach. Dziewczyną, która do uśmiechu potrzebuje kawałka słońca i odrobiny zielonej trawy. Dziewczyną, za którą ugania się stado motyli. Której muzyką trzepot skrzydeł skowronków. Dziewczyną, którą chroni ramię chłopaka, a moją czułością - jego dotyk.<br /> Jestem kobietą, która jakoś sobie radzi. Która od czasu do czasu zamyka oczy i widzi siebie i jego w przeraźliwie mocnym uścisku. Kobietą, za którą biegają jego myśli. Którą doganiają pragnienia szalonej miłości i spełnienia.<br /> Jestem dziewczyną, najzwyczajniejszą wśród tłumu nadzwyczajnych. I kobietą, pragnącą tak niewiele, a najwięcej z nich wszystkich.<br /> ________________</p></div><div class="_3x-2" data-ft="&#123;&quot;tn&quot;:&quot;H&quot;&#125;"><div data-ft="&#123;&quot;tn&quot;:&quot;H&quot;&#125;"><div class="mtm"><div class="_2a2q _65sr" style="width:500px; height:500px;"><a rel="theater" ajaxify="https://www.facebook.com/photo.php?fbid=1836949916375058&amp;set=oa.2008949019353715&amp;type=3&amp;__tn__=HH-R&amp;eid=ARCQ31xpNchZ6wLEAueKgy89ofavAYYkxgQpo8YUSVJL7x0x6Ko8j1l__j3sKy0x036GiEwGKH2Apnbq&amp;size=421%2C351&amp;source=13&amp;player_origin=photos" data-ploi="https://scontent-waw1-1.xx.fbcdn.net/v/t1.0-9/2857771